syntax = "proto3";
import "google/protobuf/timestamp.proto";

message Event {
  string uuid = 1;
  string properties = 2;
  google.protobuf.Timestamp timestamp = 3;
  uint64 team_id = 4;
  string distinct_id = 5;
  string elements_hash = 6;
  string elements_chain = 7;
  google.protobuf.Timestamp created_at = 8;
}